import React from 'react';
import { Table, Divider, Tag, Form, Select,Input,Button,DatePicker } from 'antd';


const FormItem = Form.Item;
const { Option } = Select;
const formItemLayout = {
  labelCol: { span: 8 },
  wrapperCol: { span: 12 },
};

class ShopList extends React.Component {
    constructor(props) {
        super(props);
        this.state = { 
            msg:'我是商品列表'
         };
    }
    onChange=(date, dateString)=>{
      console.log(date, dateString);
    }
    render() {
      const { form } = this.props;
      const { getFieldDecorator } = form;
        const columns = [
            {
              title: '订单编号',
              dataIndex: 'name',
              key: 'name',
            },
            {
              title: 'Age',
              dataIndex: 'age',
              key: 'age',
            },
            {
              title: 'Address',
              dataIndex: 'address',
              key: 'address',
            },
            {
              title: 'Tags',
              key: 'tags',
              dataIndex: 'tags',
              render: tags => (
                <span>
                  {tags.map(tag => {
                    let color = tag.length > 5 ? 'geekblue' : 'green';
                    if (tag === 'loser') {
                      color = 'volcano';
                    }
                    return (
                      <Tag color={color} key={tag}>
                        {tag.toUpperCase()}
                      </Tag>
                    );
                  })}
                </span>
              ),
            },
            {
              title: 'Action',
              key: 'action',
              render: (text, record) => (
                <span>
                  <a>Invite {record.name}</a>
                  <Divider type="vertical" />
                  <a>Delete</a>
                </span>
              ),
            },
          ];

          const data = [
            {
              key: '1',
              name: 'John Brown',
              age: 32,
              address: 'New York No. 1 Lake Park',
              tags: ['nice', 'developer'],
            },
            {
              key: '2',
              name: 'Jim Green',
              age: 42,
              address: 'London No. 1 Lake Park',
              tags: ['loser'],
            },
            {
              key: '3',
              name: 'Joe Black',
              age: 32,
              address: 'Sidney No. 1 Lake Park',
              tags: ['cool', 'teacher'],
            },
          ];

        return (
            <div className='info'> 
             <Form className="cc-table-filter" key="form" layout="inline">
             <FormItem {...formItemLayout} label="环境">
            {getFieldDecorator('evn', {
              initialValue: '',
              rules: [],
            })(<Select placeholder="" style={{ width: 140 }}>
              <Option value="0">33</Option>
              <Option value="1">44</Option>
              <Option value="2">stable</Option>
            </Select>)}
          </FormItem>
             <FormItem {...formItemLayout} label="订单号：">
            {getFieldDecorator('mockName', {
              initialValue: '',
              rules: [],
            })(<Input className="input-md" maxLength="100" placeholder="请输入订单编号" />)}
          </FormItem>
          <FormItem {...formItemLayout} label="乘客手机号">
            {getFieldDecorator('interfaceName', {
              initialValue: '',
              rules: [],
            })(<Input className="input-md" maxLength="100" placeholder="请输入乘客手机号" />)}
          </FormItem>
          <FormItem {...formItemLayout} label="司机手机号">
            {getFieldDecorator('interfaceName', {
              initialValue: '',
              rules: [],
            })(<Input className="input-md" maxLength="100" placeholder="请输入司机手机号" />)}
          </FormItem>
          <br />
          <DatePicker onChange={this.onChange} maxLength="100"/>

          <FormItem>
            <Button
              type="primary"
              htmlType="submit"
              onClick={() => this.onSearch(1)}
            >
查询
            </Button>
          </FormItem>
          <FormItem>
            <Button
              htmlType="submit"
              onClick={this.onReset}
            >
重置
            </Button>
          </FormItem>
        </Form>
        <Table columns={columns} dataSource={data} />

            </div>
        );
    }
}
const WrappedAdvancedSearchForm = Form.create()(ShopList);


export default WrappedAdvancedSearchForm;
